  String get Four_photos_should_be_taken_the_front_back_side_and_interior_of_the_house_n => "விண்ணப்பதாரர் அவர்கள் வசிக்கும் வீட்டை புகைப்படம் எடுக்க வசதி செய்யப்பட்டுள்ளது. \\nநான்கு புகைப்படங்கள் எடுக்கப்பட வேண்டும்: வீட்டின் முன், பின், பக்க மற்றும் உட்புறம்.\\nஇதைச் செய்ய, முதலில் புகைப்படம் எடுக்கவும் பொத்தானைக் கிளிக் செய்யவும்.\\nஉங்கள் மொபைல் ஃபோனின் கேமரா தானாகவே செயல்படும். வீட்டின் கூரை, சுவர்கள், தரை, கதவுகள் மற்றும் ஜன்னல்கள் ஆகியவற்றை முன் புகைப்படம் தெளிவாகப் படம்பிடிப்பதை உறுதி செய்து கொள்ளுங்கள்";
