  String get Enter_information_about_active_bank_accounts_belonging_to_the_applicant_or_a_family_member_nAfter_selecting_the_relevant_bank_enter_the_bank_branch_name_account_number_and_account_holder_s_name_in_the_fields_displayed_below_nSpecify_whether_the_account_ownership_belongs_to_the_applicant_a_family_member_or_a_nominee_n_n => "விண்ணப்பதாரர் அல்லது குடும்ப உறுப்பினரின் செயலில் உள்ள வங்கிக் கணக்குகள் பற்றிய தகவலை உள்ளிடவும்.\\nதொடர்புடைய வங்கியைத் தேர்ந்தெடுத்த பிறகு, கீழே காட்டப்பட்டுள்ள புலங்களில் வங்கிக் கிளையின் பெயர், கணக்கு எண் மற்றும் கணக்கு வைத்திருப்பவரின் பெயரை உள்ளிடவும்.\\n கணக்கு உரிமை விண்ணப்பதாரர், குடும்ப உறுப்பினர் அல்லது பரிந்துரைக்கப்பட்டவருக்கு சொந்தமானதா என்பதைக் குறிப்பிடவும்";
